webpackJsonp([58731286756515],{2710:function(e,t){e.exports={pathContext:{docHtml:'<h1>iMurmurHash.js</h1>\n<p>An incremental implementation of the MurmurHash3 (32-bit) hashing algorithm for JavaScript based on <a href="https://github.com/garycourt/murmurhash-js">Gary Court\'s implementation</a> with <a href="https://github.com/kazuyukitanimura/murmurhash-js">kazuyukitanimura\'s modifications</a>.</p>\n<p>This version works significantly faster than the non-incremental version if you need to hash many small strings into a single hash, since string concatenation (to build the single string to pass the non-incremental version) is fairly costly. In one case tested, using the incremental version was about 50% faster than concatenating 5-10 strings and then hashing.</p>\n<h2>Installation</h2>\n<p>To use iMurmurHash in the browser, <a href="https://raw.github.com/jensyt/imurmurhash-js/master/imurmurhash.min.js">download the latest version</a> and include it as a script on your site.</p>\n<pre><code class="language-html">&#x3C;script type="text/javascript" src="/scripts/imurmurhash.min.js">&#x3C;/script>\n&#x3C;script>\n// Your code here, access iMurmurHash using the global object MurmurHash3\n&#x3C;/script>\n</code></pre>\n<hr>\n<p>To use iMurmurHash in Node.js, install the module using NPM:</p>\n<pre><code class="language-bash">npm install imurmurhash\n</code></pre>\n<p>Then simply include it in your scripts:</p>\n<pre><code class="language-javascript">MurmurHash3 = require(\'imurmurhash\');\n</code></pre>\n<h2>Quick Example</h2>\n<pre><code class="language-javascript">// Create the initial hash\nvar hashState = MurmurHash3(\'string\');\n\n// Incrementally add text\nhashState.hash(\'more strings\');\nhashState.hash(\'even more strings\');\n\n// All calls can be chained if desired\nhashState.hash(\'and\').hash(\'some\').hash(\'more\');\n\n// Get a result\nhashState.result();\n// returns 0xe4ccfe6b\n</code></pre>\n<h2>Functions</h2>\n<h3>MurmurHash3 ([string], [seed])</h3>\n<p>Get a hash state object, optionally initialized with the given <em>string</em> and <em>seed</em>. <em>Seed</em> must be a positive integer if provided. Calling this function without the <code>new</code> keyword will return a cached state object that has been reset. This is safe to use as long as the object is only used from a single thread and no other hashes are created while operating on this one. If this constraint cannot be met, you can use <code>new</code> to create a new state object. For example:</p>\n<pre><code class="language-javascript">// Use the cached object, calling the function again will return the same\n// object (but reset, so the current state would be lost)\nhashState = MurmurHash3();\n...\n\n// Create a new object that can be safely used however you wish. Calling the\n// function again will simply return a new state object, and no state loss\n// will occur, at the cost of creating more objects.\nhashState = new MurmurHash3();\n</code></pre>\n<p>Both methods can be mixed however you like if you have different use cases.</p>\n<hr>\n<h3>MurmurHash3.prototype.hash (string)</h3>\n<p>Incrementally add <em>string</em> to the hash. This can be called as many times as you want for the hash state object, including after a call to <code>result()</code>. Returns <code>this</code> so calls can be chained.</p>\n<hr>\n<h3>MurmurHash3.prototype.result ()</h3>\n<p>Get the result of the hash as a 32-bit positive integer. This performs the tail and finalizer portions of the algorithm, but does not store the result in the state object. This means that it is perfectly safe to get results and then continue adding strings via <code>hash</code>.</p>\n<pre><code class="language-javascript">// Do the whole string at once\nMurmurHash3(\'this is a test string\').result();\n// 0x70529328\n\n// Do part of the string, get a result, then the other part\nvar m = MurmurHash3(\'this is a\');\nm.result();\n// 0xbfc4f834\nm.hash(\' test string\').result();\n// 0x70529328 (same as above)\n</code></pre>\n<hr>\n<h3>MurmurHash3.prototype.reset ([seed])</h3>\n<p>Reset the state object for reuse, optionally using the given <em>seed</em> (defaults to 0 like the constructor). Returns <code>this</code> so calls can be chained.</p>\n<hr>\n<h2>License (MIT)</h2>\n<p>Copyright (c) 2013 Gary Court, Jens Taylor</p>\n<p>Permission is hereby granted, free of charge, to any person obtaining a copy of\nthis software and associated documentation files (the "Software"), to deal in\nthe Software without restriction, including without limitation the rights to\nuse, copy, modify, merge, publish, distribute, sublicense, and/or sell copies of\nthe Software, and to permit persons to whom the Software is furnished to do so,\nsubject to the following conditions:</p>\n<p>The above copyright notice and this permission notice shall be included in all\ncopies or substantial portions of the Software.</p>\n<p>THE SOFTWARE IS PROVIDED "AS IS", WITHOUT WARRANTY OF ANY KIND, EXPRESS OR\nIMPLIED, INCLUDING BUT NOT LIMITED TO THE WARRANTIES OF MERCHANTABILITY, FITNESS\nFOR A PARTICULAR PURPOSE AND NONINFRINGEMENT. IN NO EVENT SHALL THE AUTHORS OR\nCOPYRIGHT HOLDERS BE LIABLE FOR ANY CLAIM, DAMAGES OR OTHER LIABILITY, WHETHER\nIN AN ACTION OF CONTRACT, TORT OR OTHERWISE, ARISING FROM, OUT OF OR IN\nCONNECTION WITH THE SOFTWARE OR THE USE OR OTHER DEALINGS IN THE SOFTWARE.</p>',docPath:"argo-ci/node_modules/imurmurhash/readme",proj:"argo-ci"}}}});
